import React, { useState } from 'react';
export const Login = () => {

    const [secret, setSecret] = useState('');
    function handleChange(event) {
      const inputValue = event.target.value;
      setSecret(inputValue);
    }
    async function handleSubmit(e) {
        window.location.href = '/admin/list';
    }

    return (
      <div className="my-[100px] flex flex-col items-center justify-center h-screen bg-gray-200">

        <form className="p-6 flex flex-col gap-[15px] bg-white rounded shadow-md w-[500px]" onSubmit={handleSubmit}>
          <label className="block mb-2 text-sm text-gray-700">
            비밀키
            <input
                className={`w-full px-3 py-2 mt-1 text-sm leading-tight text-gray-700 border rounded shadow appearance-none focus:outline-none focus:shadow-outline`}
                type="text"
                value={secret}
                onChange={handleChange}
            />
          </label>

          <button
            className="w-full px-4 py-2 mt-6 text-white bg-blue-500 rounded-md hover:bg-blue-700 focus:outline-none focus:shadow-outline"
            type="submit"
          >
            로그인
          </button>
        </form>
      </div>
    );
  }

  export default Login;
